func Register(sql string) string {
    openMu.RLock()
    if !open {
        openMu.RUnlock()
        return ""
    }
    openMu.RUnlock()
	myCounter := NewDigestCounter(sql)
	mu.Lock()
	defer mu.Unlock()
	dgest := digest(sql)
	counterSet[dgest] = myCounter
	return dgest
}